import Navbar from './Navbar';
import Articles from './Articles';

const navigation = [
  {
    "nom" : "Accueil",
    "lien" : "/"
  },
  {
    "nom" : "About",
    "lien" : "/about"
  },

]

function About() {
  return (
    <div>
      <Navbar info={ navigation } />
      <Articles />

    </div>
  );
}

export default About;
